const canvas = document.getElementById("canvas1");
// creating an intstance of image
const ctx = canvas.getContext("2d");

canvas.width = 800;
canvas.height = 450;
// Image() is built in constructor in JS and hence we are creating a JS object.
const image1 = new Image();
// giving the source to our image
// reason for this long string is explained below
image1.src =
    "data:image/jpeg;base64,";
// image1.src = "image1.jpg";
// js code loads very fast, hence we need to listen for the load event on image
image1.addEventListener("load", function() {
    // first argument -> image name to be loaded
    // second argument -> x coordinate
    // third argument -> y coordinate
    // in total we have 5 arguments, the last 2 being width and height
    ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
    // now we need the color of every pixel in the image
    // HTML canvas has a method buuilt in for that
    // image1.crossOrigin = "Anonymous";
    const scannedImage = ctx.getImageData(0, 0, canvas.width, canvas.height);
    // this getImageData scans all the pixels from left to right in the specified regin in arguuments
    // console.log(scannedImage);
    // i got an error here because of something called as CORS -> cross orgin resource sharing
    // chrome considers your locally stored images as cross origin and hence will give an error when the image is scanned
    // how to prevent it from happening?
    // CONVERT YOUR IMAGE INTO A DATA STRING AND PLACE THAT IMAGE DIRECTLY IN YOUR FILE
    // toDataUrl() can do it. here i have used an online tool ->online jpg tools (base 64 converter)
    // now you understand why image.src = "image1.jpg" is commented and hence the hugeeeeee data string above
    console.log(scannedImage);
    // now you get all of the correct data. the object contains numbers, what are they?
    // each pixel has rgba format now and index 0 to 3 belong to first pixel and so on
    const scannedData = scannedImage.data;
    // notice i+=4
    for (let i = 0; i < scannedData.length; i += 4) {
        // CONVERTING IMAGE TO GREYSCALE
        // if you put the same number in rgb value then you get different shades of gray.
        // so, we can take the average of rgb value for each pixel and assign it to each pixel
        let total = scannedData[i] + scannedData[i + 1] + scannedData[i + 2];
        total /= 3;
        scannedData[i] = total;
        scannedData[i + 1] = total;
        scannedData[i + 2] = total;
    }
    // overriding scannedimage data
    scannedImage.data = scannedData;
    ctx.putImageData(scannedImage, 0, 0);
});